//import SingUp from './Screens/Auth/SignUp/index.js';
import Home from './Screens/Main/Home/index.js';
import Search from './Screens/Main/Search/index.js';

import {createStore} from 'redux';

const initialState = [
  {text: 'create todos', done: false},
  {text: 'get rich', done: true}
]

const store = createStore((state) => state, initialState, window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__()); 

class App extends Component {
  render() {
    return (
      <Search/>
    );
  }
}

export default App;

